import React from 'react'

export default function GameItem({game}) {
    return (
        <div className="box" data-game={game.name} data-tags={game.tags}>
            <a href={game.url}>
                <img className="game-img" src={require(game.image)} alt={game.name} />
            </a>
        </div>
    )
}
